import React, { useState, useEffect } from "react";

const Pistols = (props) => {
  const [pistolData, setPistolData] = useState([]);
  console.log(props.fullData);

  useEffect(async () => {
    const info = await props.fullData;
    setPistolData(info);
  }, []);

  return (
    <div className="pistol-Card">
      <h2>{pistolData.documents[0]}</h2>
    </div>
  );
};

export default Pistols;
